import {React, useState, useEffect} from 'react'
import './Stats.css'

function Stats() {
    const [data,setData] = useState([])
    const [stars,setStars] = useState(0)

    useEffect(() => {
        fetch('https://api.github.com/users/iampranavdhar')
            .then(response => response.json())
            .then(result => setData(result));
        fetch('https://api.github.com/users/iampranavdhar/subscriptions')
            .then(response => response.json())
            .then(stars => setStars(stars.length));
    },[])

    console.log(stars);
    console.log(data);

    return (
        <div className='stats'>
            <h1 className='stats-title'>Stats</h1>
            <div className="github-followers">
                <p>GitHub Followers</p>
                <p>{data.followers}</p>
            </div>
            <div className="github-stars">
                <p>GitHub Stars</p>
                <p>{stars}</p>
            </div>
            <div className="github-repos">
                <p>GitHub Repos</p>
            </div>
        </div>
    )
}

export default Stats
